window.bookSummaryJSON = "<p>Sometimes it's hard to strike the right chord.</p> <p>Margot Reid has everything prepared for her first year of college. She picked her major, registered early for classes, and even brought the perfect roommate.</p> <p>The one thing she didn’t plan for is the annoying guy who plays guitar across the hall.</p> <p>Jackson Phillips may be insanely good looking, but he’s also insufferable. From the moment Margot confronts him about his constant playing, the one thing they can agree on is wanting to avoid each other at all costs. It seems like a solid plan.</p> <p>That is, until their roommates and closest friends start dating. Then every study date and late night forces them together.</p> <p>Whatever pull they feel between them is purely physical. It has to be. At least, that’s what Margot tells herself. She’s smart enough to know falling for Jackson Phillips would be a disaster. Especially when he leaves campus to become a rockstar, and she’s still studying in her dorm.</p> <p>But Jackson isn’t about to let her off that easy.</p> <p>Just Don’t Call Me Yours is a spicy enemies to lovers college romance filled with witty banter, sizzling sexual tension, and of course, rock and roll.</p>"; 
